        <div class="section">
                      <div id="breadcrumb"><a href="/docs">Contents</a> Â» <a href="/docs/browser">Browser</a> Â» <a href="/docs/browser/new-relic-browser">New Relic Browser</a> Â» <a href="/docs/browser/new-relic-browser/performance-quality">Performance Quality</a></div>
                                                                        <h1 class="title" id="page-title">Security for New Relic Browser</h1>
                                          <div class="tabs"></div>
                                        <div>
              <div class="region region-content">
    <div id="block-system-main" class="block block-system">


  <div class="content">

<article id="node-1781" class="node node-page">


  <div class="content">
    <div class="field field-name-body field-type-text-with-summary field-label-hidden"><div class="field-items"><div class="field-item even"><p><a href="/docs/browser/new-relic-browser/getting-started/introduction-new-relic-browser">New Relic Browser</a> provides insights into how your application or site behaves when it is loaded in a web browser. New Relic Browser only collects performance data, as explained in this document. It does <b>not</b> collect any data used or stored by the monitored application unless you explicitly configure it to do so. This document describes Browser's security measures.</p>

<h2 id="data">Reported data</h2>

<p>New Relic Browser reports many different types of data to help you analyze your website's performance. New Relic Browser <b>only</b> reports page view data, unless you have subscribed to &lt;a href=&quot;<a href="http://newrelic.com/browser-monitoring/pricing">http://newrelic.com/browser-monitoring/pricing</a>" target="_blank" title="Link opens in a new window."&gt;Pro features <i class="fa fa-external-link fileinfo"><span>[external link]</span></i> </a>. You can also <a href="/docs/browser/new-relic-browser/welcome-new-relic-browser/new-relic-browser#enhanced-features">enable functionality</a> for AJAX requests, JavaScript errors, and session traces.</p>

<p>For most data types, New Relic Browser transmits the data securely using SSL encryption. For more information, see <a href="/docs/browser/new-relic-browser/page-load-timing-resources/instrumentation-page-load-timing#transmission">Data transmission</a>.</p>

<div class="callout-tip">
<p>The Browser agent transmits data to New Relic's data collection servers via the domain <b><a href="bam.nr-data.net">bam.nr-data.net</a></b>.</p>
</div>

<p>Here is a summary of the types of data reported by New Relic Browser.</p>

<dl class="clamshell-list"><dt class="list-header"><span class="right-link">&lt;a class=&quot;all-link&quot; href=&quot;#all-links&quot; title=&quot;&quot; data-original-title=&quot;Show all in this section OR type <b>F</b> to show all, <br /><b>H</b> to hide all"&gt;<b>Show All</b> &nbsp; <i class="fa fa-list"></i></a></span> </dt>
	<dt id="â€œpage-view-data&quot;"><span class="right-link"><a class="more-link" href="#â€œpage-view-data"><i class="fa fa-toggle-right"><span>[show details]</span></i></a></span>Page view data</dt>
	<dd style="display:none;">
	<p>This data is reported once per page view and consists of:</p>

	<ul>
		<li>Page load timing data</li>
		<li>Name of the server-side app controller that served the page, if available (obfuscated in the page and during transmission)</li>
		<li>Additional custom parameters set by the server-side app controller, if available (obfuscated in the page and during transmission)</li>
		<li>Additional custom parameters set by the <a href="/docs/browser/new-relic-browser/browser-agent-apis/report-data-events-browser-agent-api">Browser agent API</a>, if set prior to page load</li>
	</ul>

	<p>This information appears on the <a href="/docs/browser/new-relic-browser/dashboard-details/page-views-dashboard"><b>Page views</b> page</a>.</p>

	<div class="callout-tip">
	<p>For data security reasons, New Relic Browser does not record or collect URL query strings.</p>
	</div>

	<p>Server-side data can only be collected when the host is also instrumented by New Relic, and the browser monitoring instrumentation is injected by the agent. For more information about how New Relic collects and presents this data, see <a href="/docs/browser/new-relic-browser/page-load-timing/instrumentation-page-load-timing">Instrumentation for page load timing</a>.</p>
	</dd>
	<dt id="ajax-data"><span class="right-link"><a class="more-link" href="#ajax-data" title="AJAX timing data"><i class="fa fa-toggle-right"><span>[show details]</span></i></a></span>AJAX timing data</dt>
	<dd style="display:none;">
	<p>When enabled, New Relic Browser periodically reports AJAX timing data until the user navigates away from or closes the page. (New Relic automatically filters out all AJAX requests that take longer than two minutes.) Data includes:</p>

	<ul>
		<li>Hostnames, ports, and paths (but not search/query parameters) of AJAX request URLs</li>
		<li>HTTP status code of responses</li>
		<li>Byte size of request message bodies</li>
		<li>Name of the server-side app controller servicing the AJAX request and server-side timing data (obfuscated in the page and during transmission), when the browser instrumentation is injected by the New Relic agent</li>
		<li>Timing data for the AJAX transaction</li>
		<li>Timing data for the AJAX callbacks</li>
	</ul>

	<p>This information appears on the <a href="/docs/browser/new-relic-browser/browser-pro-features/ajax-dashboard-identifying-time-consuming-calls"><strong>AJAX </strong>page</a>.</p>
	</dd>
	<dt id="js-errors-data"><span class="right-link"><a class="more-link" href="#js-errors-data" title="JavaScript error data"><i class="fa fa-toggle-right"><span>[show details]</span></i></a></span>JavaScript error data</dt>
	<dd style="display:none;">
	<p>When enabled, New Relic Browser periodically reports data about every error that occurs on the page until the user navigates away from or closes the page. This information appears on the <a href="/docs/browser/new-relic-browser/browser-pro-features/js-errors-dashboard-examining-errors-over-time"><strong>JavaScript errors</strong> page</a>.</p>

	<p>For each error, the data includes:</p>

	<ul>
		<li>Exception class of the error</li>
		<li>Error message containing arbitrary text</li>
		<li>Stack trace of the error, which may contain function names and URLs of scripts causing the error</li>
	</ul>

	<p>Error messages typically do not contain any confidential or sensitive information. However, it is possible for messages to be purposefully constructed with sensitive information. Before enabling JavaScript error reporting, ensure that your website does not expose any sensitive information in error messages.</p>
	</dd>
	<dt id="session-trace-data"><span class="right-link"><a class="more-link" href="#session-trace-data" title="Session trace data"><i class="fa fa-toggle-right"><span>[show details]</span></i></a></span>Session trace data</dt>
	<dd style="display:none;">
	<p>When enabled, New Relic Browser periodically reports data on the details of the a single page's life cycle, including user interactions, AJAX loads, and JavaScript errors, until the user navigates away from or closes the page. New Relic automatically stops recording further data after ten minutes. Data includes:</p>

	<ul>
		<li>Asset load timing details</li>
		<li>User interactions such as scrolling, mousing, and clicking</li>
		<li>JavaScript error timing and other JavaScript error information</li>
		<li>Triggered Javascript events</li>
	</ul>

	<p>Session traces are captured randomly at a fixed rate from among the monitored page views. Session trace information appears on the <a href="/docs/browser/new-relic-browser/browser-pro-features/session-traces-exploring-webpages-life-cycle"><strong>Session traces</strong> page</a>.</p>
	</dd>
	<dt id="spa-data"><span class="right-link"><a class="more-link" href="#spa-data" title="SPA data"><i class="fa fa-toggle-right"><span>[show details]</span></i></a></span>SPA data</dt>
	<dd style="display:none;">
	<p>In addition to the data above, for customers using New Relic single-page application (SPA) monitoring, this data is reported once per page load or route change:</p>

	<ul>
		<li>Hash fragments associated with route changes</li>
		<li>Additional custom parameters added via the <a href="/docs/browser/new-relic-browser/browser-agent-apis/new-relic-spa-api">SPA API</a></li>
	</ul>

	<p>When SPA monitoring has been enabled, this information appears on the <a href="/docs/browser/single-page-app-monitoring/browser-ui/view-spa-data-new-relic-browser"><b>Page views</b> page</a>.</p>

	<p>As is the case for page view timing data, server-side data can only be collected when the host is also instrumented by New Relic, and the browser monitoring instrumentation is injected by the agent. For more information about how New Relic collects and presents this data, see <a href="/docs/browser/new-relic-browser/page-load-timing/instrumentation-page-load-timing">Instrumentation for page load timing</a>.</p>
	</dd>
</dl>

<h2 id="url-strings">URL query strings</h2>

<p>The Browser agent uses the HTTP <code>referer</code> attribute to track page URLs. URLs can sometimes contain potentially sensitive user-entered query data (for example, a user's name). For data security reasons, Browser does not record or collect URL query strings.</p>

<h2 id="types">Browser types</h2>

<p>New Relic Browser determines the browser type from the <code>User-Agent</code> header and the geographical location based on the browser's IP address. New Relic does not retain the IP address, only the country and region associated with the performance data.</p>

<p>This information appears on the selected app's <a href="/docs/browser/new-relic-browser/additional-standard-features/geography-webpage-performance-location"><strong>Geography</strong> page</a>. Also, details about specific browser types appear on the selected app's <a href="/docs/browser/new-relic-browser/additional-standard-features/browsers-problem-patterns-type-or-location"><strong>Browsers</strong> page</a>.</p>

<h2 id="traces">Browser trace details</h2>

<p>If New Relic captures a browser trace, it also includes the city associated with the IP address (if any). <a href="/docs/apm/traces/browser-traces/browser-traces">Browser trace details</a> appear on the <a href="/docs/browser/new-relic-browser/dashboard-details/page-views-dashboard"><strong>Page views</strong> page</a>.</p>

<p>Browser traces are replaced by <a href="/docs/browser/new-relic-browser/browser-pro-features/session-traces-exploring-webpages-life-cycle">browser session traces</a> if using Browser Pro, to provide a more detailed timeline of the load and interaction events during a webpage's life cycle.</p>

<h2 id="cdn">CDN access</h2>

<p>Page load timing requires access to the content delivery network (CDN), where New Relic's utility JavaScript file (<b>nr.js</b>) is hosted. The domain name for the file (<b><a href="js-agent.newrelic.com">js-agent.newrelic.com</a></b>) remains static, but the number in the path (version) may change periodically.</p>

<p>A <code>script</code> tag is injected by the New Relic agent (or pasted into the webpage for standalone apps) that references the JavaScript on the CDN, which is then loaded by the browser. The loaded JavaScript collects and reports the metrics dynamically to the domain <b><a href="bam.nr-data.net">bam.nr-data.net</a></b>.</p>

<div class="callout-tip">
<p>If your end users are behind a firewall or proxy and do not have access to the CDN or to New Relic's networks (including <b><a href="bam.nr-data.net">bam.nr-data.net</a></b>), New Relic Browser will not work. For more information about host locations and IP addresses for sending data to New Relic, see <a href="/docs/apm/new-relic-apm/getting-started/networks">Networks</a>.</p>
</div>

<h2 id="cookies">Cookies</h2>

<p>New Relic Browser creates <a href="/docs/browser/new-relic-browser/page-load-timing-resources/new-relic-cookies">cookies</a> in the end user's browser. If the user has cookies disabled, page load timing (sometimes referred to as real user monitoring or RUM) will not be able to track sessions properly. Also, if the user has an older browser that does not support the <a href="/docs/browser/new-relic-browser/browser-agent-apis/navigation-timing-api">Navigation Timing Specification API</a>, page load timing will not be able to track response times as accurately.</p>

<p>New Relic's cookies for browser monitoring do not contain the <code>secure</code> attribute. This is because page load timing data is sent over HTTP when the page is HTTP, but over HTTPS when the page is HTTPS. For more information, see <a href="/docs/browser/new-relic-browser/page-load-timing-resources/instrumentation-page-load-timing#transmission">Data transmission</a>.</p>

<p>JavaScript and AJAX data may contain more sensitive information, so they are <b>always</b> transmitted over HTTPS. Transmission of these cookies via HTTP or access to them from JavaScript is not a significant security risk, because the cookies are not used to make security decisions or allow access to an account. They are used only to collect performance data, with any identifiable data obfuscated.</p>

<div class="callout-tip">
<p>If the site uses &lt;a href=&quot;<a href="http://www.w3.org/p3p/">http://www.w3.org/p3p/</a>" target="_blank" title="Link opens in a new window."&gt;P3P <i class="fa fa-external-link fileinfo"><span>[external link]</span></i> </a>, it must be configured to allow these cookies.</p>
</div>

<h2 id="jsonp">JSONP requests</h2>

<p>Page load timing metrics are reported to New Relic using a Script GET, also known as a JSONP request. The Script GET returns a value that is subsequently stored in a cookie and used to trigger trace capturing.</p>

<h2 id="more_help">For more help</h2>

<p>Additional documentation resources include:</p>

<ul>
	<li><a href="/docs/accounts-partnerships/accounts/security/security">Security</a> (additional information about New Relic's security measures)</li>
	<li>&lt;a href=&quot;<a href="http://trust.newrelic.com">http://trust.newrelic.com</a>" target="_blank" title="Link opens in a new window."&gt;New Relic's Corporate Security site <i class="fa fa-external-link fileinfo"><span>[external link]</span></i> </a> (corporate information and video)</li>
</ul>
